PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE question(
        id varchar(50) primary key not NULL,-- 主键
        question text unique not NULL, -- 地图
        answer text,  -- 最佳答案
        hard int,-- 问题的难度
        hash varchar(128),-- 地图的key
        extra text,-- json格式的extra
        solve_times int);
COMMIT;
